import React, {useEffect} from 'react'

import './Products.css'
import ProductItem from './ProductItem'
import CompanyGroup from './CompanyGroup'
import {searching} from '../../actions'
import {OrganizationType} from '../../dto/Product'
import {useSelector} from 'react-redux'
import {selectSearchProducts} from '../../selectors/search'


export default function Products() {
    useEffect(() => {
        searching('')
    },[ ])

    const products = useSelector(selectSearchProducts)

    return (
        <div className="products">
            { Object.values(products).map((product) => (
                <div className="products-item">
                    <ProductItem products={product}/>
                    <CompanyGroup title="Организации" type={OrganizationType.ORG}/>
                    <CompanyGroup title="Индивидуальные предприниматели" type={OrganizationType.IP}/>
                    <CompanyGroup title="Самозанятые" type={OrganizationType.SAM}/>
                </div>
            ))}
        </div>
    )
}
